import React from 'react';
import { Typography, Button, Link } from '@mui/material';
import { DefaultPageContainer } from '../default/defaultPageContainer.styled';
import { StyledLoginPageContainer } from './containers/login-page.container.styled';

const LoginPageComponent = () => {
  const a = 0;
  return (
    <DefaultPageContainer>
      <StyledLoginPageContainer>
        <Typography variant="h3">Todo App</Typography>
        <Button className="action" href="/common" variant="contained">
          Login
        </Button>
        <Button className="action" variant="contained">
          Register
        </Button>
        <Link variant="button">Forget password?</Link>
      </StyledLoginPageContainer>
    </DefaultPageContainer>
  );
};

export default LoginPageComponent;
